import {ImageCardList} from '../../components/ChooseImage';


interface IPage{
    dpage: string;
}


function PageDisplay(props : IPage)  {

    // const nav = props;

    if(props.dpage=="1"){
    return(
        <ImageCardList/>
    );
    }else if(props.dpage=='2'){
    return(
        <h1>HI</h1>
    );
    }else if(props.dpage=='3'){
    return(
        <h1>HI</h1>
    );
    }else if(props.dpage=='4'){
    return(
        <h1>HI</h1>
    );
    }else if(props.dpage=='5'){
    return(
        <h1>HI</h1>
    );

    }

    return null;

};

export default PageDisplay;

